import { Card, Flex, Typography } from 'antd';

const data = {
    "important_events": [
        {
            "name": "Birthday Celebration",
            "date": "2024-04-15"
        },
        {
            "name": "Project Deadline",
            "date": "2024-03-20"
        },
        {
            "name": "Meeting with Client",
            "date": "2024-03-25"
        },
        {
            "name": "Family Vacation",
            "date": "2024-07-10"
        }
    ]
}



function Calendar() {
    return (
        <div style={{ marginTop: "30px", justifyContent: "center" }}>
            <h1 className="header-title" style={{ textAlign: "center", marginBottom: "30px" }}> Dila & Hanif calendar.</h1>

            <Flex justify='center'>

                <Card
                    hoverable
                    style={{ width: "400" }}
                    styles={{ body: { padding: 0, overflow: 'hidden' } }}>
                    <Flex>
                        <img
                            alt="avatar"
                            src="http://picsum.photos/300/300"
                            style={{ display: 'block', width: 250 }} />
                        <Flex
                            align="center"
                            justify='flex-start'
                            style={{ padding: 32 }}>

                            <Typography.Title level={2}>
                                Akad Nikah
                                <br />
                                12 Maret 2023
                            </Typography.Title>

                        </Flex>
                    </Flex>
                </Card>
            </Flex>
        </div>
    )
}

export default Calendar
